import React from "react";
import {Modal, ModalHeader, ModalBody, Button } from 'reactstrap';

class Authanticate extends React.Component{
    render(){
        return(
            <div>
                <Modal isOpen={this.props.signup} toggle={()=>this.props.setsignup()}>
                    <ModalHeader style={{textAlign:"center"}}>Sign In</ModalHeader>
                    <ModalBody>
                        <div className="signin">
                            <span><Button size="md" color="danger"><i class="fab fa-google"></i></Button></span>
                            <span><Button size="md" color="black"></Button><i class="fab fa-github"></i></span>
                        </div>
                    </ModalBody>
                </Modal>
            </div>
        );
    }
}

export default Authanticate;
